import React from 'react';
import '../../App.css';
import Footer from '../Footer';
import Admin from './Admin';
import AdminNavbar from './AdminNab';
import UserNavbar from './UserNavbar';

function UserHome() {
  return (
    <>
       <UserNavbar/>
       <div className='cards'>
    <h1>HELLO</h1>
    <CardItem
              src='images/gim1.jpg'

              text='Drive with pride in a clear car.'
              label='Quick wash'
              path='/signup'
            />
    </div>
       <Footer/>
    </>
  );
}

export default UserHome;
